import React from 'react'
import patientsListCards from "./patientsListCards"

class App extends React.Component {

    constructor() {
        super();
        this.state = {
            patientData: [],
        }
    }

    render() {
        return (
            <div>
                <h2> Patients </h2>
                {this.state.patientData.map(patientData => (
                <patientsListCards patientData={patientData} />   
                ))}
            </div>
        )
    }

}

export default App;
